drop view if exists economie_militari_q7;
create temp view economie_militari_q7 as
select economies.country,
       military,
       gdp,
       population,
       cast(gdp as bigint)             as gdpb,
       cast(military as decimal) / 100 as mild
from economies
         inner join populations p on economies.country = p.country;


drop view if exists economie_militari_pro_capite_q7;
create temp view economie_militari_pro_capite_q7 as
select country, military, gdp, population, round(cast(gdpb * mild / population as numeric), 2) as val_pro_capite
from economie_militari_q7;

create temp view max_q7 as
select val_pro_capite, country
from countries
         inner join economie_militari_pro_capite_q7 on country = code
where economie_militari_pro_capite_q7.val_pro_capite =
      (select val_pro_capite from economie_militari_pro_capite_q7 order by val_pro_capite desc limit 1);


create temp view min_q7 as
select val_pro_capite, country
from countries
         inner join economie_militari_pro_capite_q7 on country = code
where economie_militari_pro_capite_q7.val_pro_capite =
      (select val_pro_capite from economie_militari_pro_capite_q7 order by val_pro_capite limit 1);



create temp view avg_q7 as
select avg(val_pro_capite) as "avg"
from economie_militari_pro_capite_q7;


select val, name
from (
         select round(val_pro_capite, 2) as "val", country as "name", 1 as "id"
         from max_q7
         union
         select round(val_pro_capite, 2) as "val", country as "name", 2 as "id"
         from min_q7
         union
         select round(avg, 2) as "val", NULL as "name", 3 as "id"
         from avg_q7
         order by id, val, name
     ) sub;

